def skyserver_csv_download(qry, name, output, qry_log=True):
    qry_repl = qry.replace(" ", "+")
    qry_web = qry_repl.replace("%", "%25")

    # regex for matching single line containing the end of a record.
    pattern_eol = r"(\,0\,\,1\n)"

    # When log URL has to be used 'type_log' has to be True, if False table data URL will be used
    url = {
        True: f"http://skyserver.sdss.org/log/en/traffic/x_sql.asp?cmd={qry_web}&format=csv",
        False: f"http://skyserver.sdss.org/dr16/en/tools/search/x_results.aspx?searchtool=SQL&TaskName=Skyserver.Search.SQL&syntax=NoSyntax&ReturnHtml=true&cmd={qry_web}&format=csv&TableName="
    }

    csv_output = output.as_posix()
    csv_file = f"{csv_output}/{name}.csv"

    # Download output of the query as csv in given directory.
    csv_download = wget.download(url[qry_log], out=csv_output)

    # Open downloaded csv and write to new csv file.
    with open(csv_download,'rb') as downloaded_file, open(csv_file, 'w', newline='') as file_:
        # Skipping the first line for table data or query logs.
        if not qry_log:
            # Skip the first line of the table data, which is just the query statement.
            next(downloaded_file)
        else:
            # Skip the first line which is the header of the csv file and write immediately to new csv file.
            header = next(downloaded_file)
            file_.write(header.decode('utf-8'))

        for line in downloaded_file:
            # When the file contains query log data, remove \r\n (crlf), which are unnecessary whitelines/spacees.
            if qry_log:
                line = line.replace(b"\r\n", b" ")
                
                # match = re.match(test1, line.decode('utf-8'))
                match = re.match(pattern_eol, line.decode('windows-1252'))
                if bool(match) == False:
                    line = line.replace(b"\n", b" ")
                    line = line.replace(b",0,,1 ", b",0,,1\n")
                
                file_.write(line.decode('windows-1252'))
            
            else:
                # Write row of table data to new CSV file.
                file_.write(line.decode('utf-8'))

    # Delete downloaded csv.
    Path(csv_download).unlink()


def merge_skyserver_tables(table_name, table_dir):
    files_dir = table_dir / table_name

    # Get all csv files in the given directory.
    tables_csv = files_dir.glob('*.csv')
    paths_csv = [path.as_posix() for path in tables_csv]
    paths_csv.sort(reverse=True)

    df_total = pd.read_csv(paths_csv[0])

    for i in range(1, len(paths_csv)):
        df_temp = pd.read_csv(paths_csv[i])
        df_total = pd.concat([df_total, df_temp], axis=0).drop_duplicates().reset_index(drop=True)
    
    df_total.to_csv(table_dir.as_posix() + f"/{table_name}.csv", float_format="%g", header=True, index=False)


def frequency_table(file_, dir):
    spark = SparkSession.builder.getOrCreate()
    pattern_table = r".+(FROM|from)\ +\.?\.?(\w+).+"
    pattern_dismiss = r"f.+|specobj|specobjall|SpecObj|SpecObjAll|dbo"

    # Get all csv files in the given directory.
    files_csv = dir.glob('*.csv')
    paths_csv = [path.as_posix() for path in files_csv]
    
    df = spark.read.options(header=True, delimiter=",").csv(file_)
    list_queries = df.select("statement").collect()

    # Using the global freq_table Dictionary.
    global freq_table

    for qry in list_queries:
        if qry.statement is not None and re.search(pattern_table, qry.statement):
            match = re.match(pattern_table, qry.statement)
            # print("Full match:", match)
            # print("Regex match is:", match.group(2))

            if bool(re.match(pattern_dismiss, match.group(2))):
                continue

            # Check if the table name, in lowercase, is already in the dictionary, otherwise create new key. Is made lowercase, since queries sometimes have the tablenames as CamelCase.
            if (match.group(2).lower() in freq_table):
                freq_table[match.group(2).lower()] += 1
            else:
                freq_table[match.group(2).lower()] = 1

    # Sort the dictionary on values in ascending order.
    freq_table = dict(sorted(freq_table.items(), key=lambda item:(item[1], item[0]), reverse=True))
    
    # Output name of the whole dictionary.
    out_dict = "freq_table_names.csv"
    # print(out_dict)

    # Output name of top 20 of freq_dict and selecting top 20 of the Dictionary freq_dict.
    out_dict_selection = "freq_table_top20.csv"
    freq_top = dict(islice(freq_table.items(), 20))
    
    # Write global Dictionary freq_table to a csv file.
    with open(out_dict, 'w') as csv_complete, open(out_dict_selection, 'w') as csv_selection:
        writer_complete = csv.writer(csv_complete)
        writer_selection = csv.writer(csv_selection)

        for key, value in freq_table.items():
            writer_complete.writerow([key, value])
        
        for key, value in freq_top.items():
            writer_selection.writerow([key, value])


def export_only_queries(qry_log, dir):
    original_log = (dir / qry_log).as_posix() + ".csv"
    output_file = (dir / "only_queries.csv").as_posix()

    with open(original_log) as log, open(output_file, 'w') as new_csv:
        csv_reader = csv.DictReader(log)
        csv_writer = csv.writer(new_csv)

        for row in csv_reader:
            # print(row["statement"])
            csv_writer.writerow([row["statement"]])




